import React from 'react'
import Header from '../components/Header'
import 'bootstrap/dist/css/bootstrap.min.css';

import './Home.css'

const Home = () => {
    return (
        <>
            <Header />
            <div>
                <img id="img-banner" src="images/lap.jpg"/>
                <h1>Laptops That Bring Out the Best In You</h1>

            </div>

        </>
    );
}

export default Home;
